// productActions.js
import * as types from './types';

export function fetchMedicineProductsRequest() {
  return { type: types.FETCH_MEDICINE_PRODUCTS_REQUEST };
}

export function fetchMedicineProductsSuccess(data) {
  return { type: types.FETCH_MEDICINE_PRODUCTS_SUCCESS, data };
}

export function fetchMedicineProductsFailure(error) {
  return { type: types.FETCH_MEDICINE_PRODUCTS_FAILURE, error };
}
